def upgrade() -> None:
    conn = op.get_bind()

    # Check if data already exists
    result = conn.execute(text("SELECT COUNT(*) FROM trips"))
    trip_count = result.scalar()
    if trip_count > 0:
        print(f"Trips table already has {trip_count} records. Skipping seeding.")
        return

    # Split by semicolon and execute each statement
    statements = [s.strip() for s in SEED_SQL.split(";") if s.strip()]
    for stmt in statements:
        if stmt:
            # Use INSERT IGNORE for visits to skip existing rows
            if "INSERT INTO `visits`" in stmt:
                stmt = stmt.replace("INSERT INTO", "INSERT IGNORE INTO")
            conn.execute(text(stmt))

    print("Seeded travel data successfully.")


def downgrade() -> None:
    conn = op.get_bind()
    # Clear seeded data in reverse order (respecting foreign keys)
    conn.execute(text("DELETE FROM trip_cities"))
    conn.execute(text("DELETE FROM trip_destinations"))
    conn.execute(text("DELETE FROM trips"))
    conn.execute(text("DELETE FROM visits"))
    conn.execute(text("DELETE FROM cities"))

